                      versions={["show-price", "full-height"]}
                      title={el.title}
                      subTitle={el.subTitle}
                      image={el.image}
                      price={el.price && el.price.sale_price}
                      mg={el.totalcbdmg}
                    />
                  </div>
                ))} */}
          </div>
        </div>

        <div
          className="consult-doc-banner-wrapper"
          style={{ padding: '4rem 0' }}
        >
          <button
            className="top-btn"
            style={{ fontSize: 'x-large' }}
            onClick={() => toTop()}
          >
            BACK TO TOP{' '}
            <LazyLoadImage
              className="top"
              style={{ height: '20px', marginBottom: '5px' }}
              src="/images/arrow-up.png"
              alt="to-top"
            />
          </button>
        </div>
      </div>
    </Layout>
  );
};

